        external
        view
        checkOwner(msg.sender)
        returns (Patient[] memory)
    {
        Patient[] memory patientData = new Patient[](bloodUniqueId);
        for (uint256 i = 0; i < patients.length; i++) {
            Patient memory newStructData = Patient(
                mappedPatient[i].patientName,
                mappedPatient[i].age,
